import React, { useEffect, useState } from 'react';

const FeedbackDetails = () => {
  const [feedbacks, setFeedbacks] = useState([]);

  useEffect(() => {
    const fetchFeedbacks = async () => {
      try {
        const response = await fetch('http://localhost:3001/feedback');
        const data = await response.json();
        setFeedbacks(data);
      } catch (error) {
        console.error('Error fetching feedbacks:', error);
      }
    };

    fetchFeedbacks();
  }, []);

  return (
    <>
      <div className="container mx-auto p-4 mt-8">
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold mb-4">
            Welcome, Admin!
          </h1>
          <p className="text-lg">
            Here are some important Feedbacks
          </p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {feedbacks.map(feedback => (
            <React.Fragment key={feedback.id}>
              <div className="bg-white p-6 rounded-lg shadow-lg">
                <h2 className="text-xl font-bold">Aspect</h2>
                <p>{feedback.aspect}</p>
              </div>
              <div className="bg-white p-6 rounded-lg shadow-lg">
                <h2 className="text-xl font-bold">Satisfaction Level</h2>
                <pre>{JSON.stringify(feedback.satisfaction_level, null, 2)}</pre>
              </div>
              <div className="bg-white p-6 rounded-lg shadow-lg">
                <h2 className="text-xl font-bold">Improvement Suggestions</h2>
                <p>{feedback.improvement_suggestions}</p>
              </div>
            </React.Fragment>
          ))}
        </div>
      </div>
    </>
  );
};

export default FeedbackDetails;
